def get_content(arch, arch_data, arch_to_most_fitting_actors):
    means = arch_data[arch]['mean']
    gender = arch_data[arch]['gender']
    res = template_avg.format(arch_name = arch,
                              gender = 'Female' if gender == 'F' else 'Male',
                              height = f"{means[0] * 100:.0f}",
                              weight = f"{means[1]:.0f}",
                              years=f"{means[2]:.0f}")
    for _, top_actor in arch_to_most_fitting_actors[arch][:3].iterrows():
      ethnicity = top_actor['ethn_name']
      if isinstance(ethnicity, float):
         ethnicity = None
      res += template_actor.format(actor_name = top_actor['actor_name'],
                                  height=f"{top_actor['actor_height'] * 100 :.0f}",
                                  weight=f"{top_actor['weight']:.0f}",
                                  ethn=f'<div>ethnicity: {ethnicity}</div>' if ethnicity is not None else '',
                                  img_url = actor_name_to_image.get(top_actor['actor_name'], ''),
                                  photo_url = actor_name_to_imdb.get(top_actor['actor_name'], ''))
    return res


def get_actor_overview_html(archetypes, arch_data, arch_to_most_fitting_actors):
    res_html = html_prefix
    for i, arch in enumerate(archetypes): 
        is_active = " active" if i == 0 else ""
        res_html += f'\t\t<div class="tab{is_active}" data-target="tab{i + 1}">{arch}</div>'
    res_html += '\t</div>\n\t<div class="tab-content">\n'
    for i, arch in enumerate(archetypes):
        is_active = 'class="active tab-content-child"' if i == 0 else 'class="tab-content-child"'
        res_html += f'    <div id="tab{i + 1}" {is_active}>{get_content(arch, arch_data, arch_to_most_fitting_actors)}</div>'
    res_html += html_suffix
    return HTML(res_html)